let audio1 = new Audio('data:audio/x-mp3;base64,');


const container1 = document.getElementById('container1');
const button1 = document.getElementById('button1');
const canvas1 = document.getElementById('canvas1');
const file1 = document.getElementById('file-upload1');
const ctx1 = canvas1.getContext('2d');
canvas1.width = container1.offsetWidth;
canvas1.height = container1.offsetHeight;
let audioSource1;
let analyser1;

button1.addEventListener('click', function() {
    const audioContext1 = new AudioContext();
    audio1.play();
    audioSource1 = audioContext1.createMediaElementSource(audio1);
    analyser1 = audioContext1.createAnalyser();
    audioSource1.connect(analyser1);
    analyser1.connect(audioContext1.destination);
    analyser1.fftSize = 32;
    const bufferLength1 = analyser1.frequencyBinCount;
    const dataArray1 = new Uint8Array(bufferLength1);

    const barWidth1 = (canvas1.width/2)/bufferLength1;
    let barHeight1;
    let x;

    function animate1() {
        x = 0;
        ctx1.clearRect(0, 0, canvas1.width, canvas1.height);
        drawVisualiser(bufferLength1, x, barWidth1, barHeight1, dataArray1);
        analyser1.getByteFrequencyData(dataArray1);
        requestAnimationFrame(animate1);

    }
    animate1();
});


file1.addEventListener('change', function() {
    const audioContext1 = new AudioContext();
    const files1 = this.files;
    const audio1 = document.getElementById('audio1');
    audio1.src = URL.createObjectURL(files1[0]);
    audio1.load();
    audio1.play();
    audioSource1 = audioContext1.createMediaElementSource(audio1);
    analyser1 = audioContext1.createAnalyser();
    audioSource1.connect(analyser1);
    analyser1.connect(audioContext1.destination);
    analyser1.fftSize = 256;
    const bufferLength1 = analyser1.frequencyBinCount;
    const dataArray1 = new Uint8Array(bufferLength1);

    const barWidth1 = canvas1.width/bufferLength1;
    let barHeight1;
    let x;

    function animate1() {
        x = 0;
        ctx1.clearRect(0, 0, canvas1.width, canvas1.height);
        drawVisualiser(bufferLength1, x, barWidth1, barHeight1, dataArray1);
        analyser1.getByteFrequencyData(dataArray1);
        requestAnimationFrame(animate1);
    }
    animate1();

})


function drawVisualiser(bufferLength1, x, barWidth1, barHeight1, dataArray1) {
    for (let i = 0; i < bufferLength1; i++) {
        barHeight1 = dataArray1[i] * 2;
        const red = i * barHeight1/20;
        const green = i * 4;
        const blue = barHeight1/2;
        ctx1.fillStyle = 'white';
        ctx1.fillRect(canvas1.width/2 - x, canvas1.height - barHeight1 -30, barWidth1, 15);
        ctx1.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx1.fillRect(canvas1.width/2 - x, canvas1.height - barHeight1, barWidth1, barHeight1);
        x +=barWidth1;
    }
    for (let i = 0; i < bufferLength1; i++) {
        barHeight1 = dataArray1[i] * 2;
        const red = i * barHeight1/20;
        const green = i * 4;
        const blue = barHeight1/2;
        ctx1.fillStyle = 'white';
        ctx1.fillRect(x, canvas1.height - barHeight1 -30, barWidth1, 15);
        ctx1.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx1.fillRect(x, canvas1.height - barHeight1, barWidth1, barHeight1);
        x +=barWidth1;
    }
}






